import React, { useState, useEffect, useRef } from 'react';
import axios from 'axios';



import { Box, IconButton, Avatar, Typography, List, ListItem, ListItemIcon, ListItemText } from '@mui/material';
import { Dashboard, VideoLibrary, Analytics, Comment, Subtitles, Copyright, Settings, Feedback, People,ThumbDown,ThumbUp} from '@mui/icons-material';
import VideoCallSharpIcon from '@mui/icons-material/VideoCallSharp';

import ProductUpload from './Admin/ProductUpload';


const Setup = () => {




    const [selectedItem, setSelectedItem] = useState('Dashboard');

    const handleItemClick = (item) => {
      setSelectedItem(item);
    };
  
    const renderContent = () => {
      switch (selectedItem) {
        case 'Create' :
          return <> <ProductUpload/> </>;
        case 'Dashboard':
          return <> <ProductUpload/> </>
        case 'Content':
          return <Typography variant="h6">Content Library</Typography>;
        case 'Analytics':
          return <Typography variant="h6">Analytics Data</Typography>;
        default:
          return <> <ProductUpload/> </>
      }
    };


  return (
    <>

      <div className='create' style={{marginLeft:''}}>
      
      <Box sx={{ display: 'flex', backgroundColor:''}}>
      <Box sx={{height: '150vh',width: '240px',backgroundColor: '',color: 'black',padding: '10px 20px',display: 'flex',flexDirection: 'column',alignItems: 'center',boxShadow: '2px 0 5px rgba(0,0,0,0.1)'}}>
        <Box sx={{ marginBottom: '20px', textAlign: 'center' }}>
          <Avatar src=" " alt="Gauri Shankar Khadga" sx={{ width: 140, height: 110 }} style={{marginLeft:'',margin:'10px',borderRadius:'10%'}}/>

          <Typography variant="body2" sx={{ color: 'gray' }}>
            ADMIN
          </Typography>
        </Box>


        <List component="nav" style={{overflow:'auto',height:'1000px',scrollbarWidth:'none',marginTop:'10px',backgroundColor:'',width:'170px'}}>
          <ListItem button onClick={() => handleItemClick('Create')}>
            <ListItemIcon>
              <VideoCallSharpIcon sx={{ color: 'black' }} />
            </ListItemIcon>
            <ListItemText primary="Create" />
          </ListItem>
          
          <ListItem button onClick={() => handleItemClick('Likes')}>
            <ListItemIcon>
              <ThumbUp sx={{ color: 'black' }} />
            </ListItemIcon>
            <ListItemText primary="Likes" />
          </ListItem>


        </List>
      </Box>
      <hr style={{marginTop:'-10px',color:'black'}}/>

      

      <Box sx={{ flex: 1, padding: '20px', backgroundColor: 'black',width:'1300px',position:'static' }}>
      <div className="divider" style={{borderTop:'1px solid #333',width:'100%',marginLeft:'-40px',marginTop:'-20px'}}></div>
        {renderContent()}
      </Box>
    </Box>

      </div>

    </>
  )
}
export default Setup
